window.bookSummaryJSON = "<p>From best selling author Willow Winters comes the second collection in the smoldering fantasy Wounded Kiss World. Following To Be Claimed, To Be Fated continues the fast paced and sizzling fated mates romances.<br> <br> Fate never prepared them and, for some, it may be too late. <br> <br> If you enjoy sexy, paranormal romances and stand-alone, insta-love stories, complete with a happily ever after, this book is for you. This collection contains three standalones.<br> <br> Please note, this collection can be listened to without having listened to anything else but it is highly recommended to listen to To Be Claimed first so you can fully enjoy how the world unravels and how these tales weave together.</p>"; 
